package com.leetcode.arrays;

import java.util.HashMap;


public class ValidAnagram {
	class Solution {
		public boolean isAnagram1(String s, String t) {
	        if (s.length() != t.length()) return false;

	        int[] store = new int[26];

	        for (int i = 0; i < s.length(); i++) {
	            store[s.charAt(i) - 'a']++;
	            store[t.charAt(i) - 'a']--;
	        }

	        for (int n : store) if (n != 0) return false;

	        return true;
	    }
		
	    public boolean isAnagram(String s, String t) {
	        if(s.length()!=t.length()) {
	        	return false;
	        }
	 
	        HashMap<Character, Integer> smap = new HashMap<>();
	        for(int i=0;i<s.length();i++) {
	        	smap.put(s.charAt(i), 1+smap.getOrDefault(s.charAt(i),0));
	        	smap.put(t.charAt(i), -1+smap.getOrDefault(t.charAt(i),0));
	        }
	        for(Integer i : smap.values()) {
	        	if(i!=0) {
	        		return false;
	        	}
	        }
	        return true;
	    }
	}


	public static void main(String[] args) {
		
		ValidAnagram va = new ValidAnagram();
		Solution s =  va.new Solution();
		String test1 = ""; 
		String test2 = "";
		System.out.println(s.isAnagram(test1,test2));
		System.out.println(s.isAnagram1(test1,test2));

	}

}
